import './App.css';
import Header from './Components/Header';
import Barnner from './Components/Barnner';
import Services from './Components/Services';
import About from './Components/About';
import Counter from './Components/C';


function App() {
  return (

    <div className="App">
      <Header />
      <Barnner/>
      <Services/>
      <About/>
      <Counter/>
    </div>
  );
}

export default App;
